import React from 'react';
import '../assets/css/CustomOrder.css';
import BackBar from '../components/BackBar';
import {InputItem } from 'antd-mobile';
import TagBtn from '../components/TagBtn';
import TagTwoBtn from '../components/TagTwoBtn';
class CustomOrder extends React.Component {
    constructor(props){
      super(props);
      this.state={

      }
    }
    changeTagSta=(v)=>{

    }
    render() {
       const { history }=this.props;
        return(
          <div className="App">
             <BackBar history={history}/>
             <div className="CustomOrderTitle">凑单金额<span>(会在这个金额的10元左右浮动)</span></div>
             <div className="CustomOrderInput"><InputItem placeholder="输入还需要凑单的金额"/></div>
             <div className="CustomOrderTitle" style={{marginTop:"35px",}}>商品种类</div>
             <div className="CustomOrderTag">
               <div className="CustomOrderCrid"><TagBtn title="手机" tagIndex={0} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="运动" tagIndex={1} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="数码" tagIndex={2} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="家具" tagIndex={3} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="食品" tagIndex={4} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="彩妆" tagIndex={5} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="女装" tagIndex={6} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="电器" tagIndex={7} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderCrid"><TagBtn title="母婴" tagIndex={8} onChange={this.changeTagSta}/></div>
               <div className="CustomOrderSubmit"><TagTwoBtn resetAble={true}/></div>
             </div>
          </div>
        );
    }
}

export default CustomOrder;
